export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:h,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:h,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:i,pageSize:25,pageCount:i,total:5}}},GQVj5IAph8:{data:{id:737,attributes:{imdbId:"tt0052716",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNDE0NDE5Mzk0NF5BMl5BanBnXkFtZTgwOTE4Nzk1MDE@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"}],item_lang:{data:{id:1400,attributes:{title:e,plot:"Puerto Rican ex-con tries to go straight, but is tempted back to his old life by his former gang.",slug:"cry-tough"}}},books:{data:[{id:4764,attributes:{title:e,description:j,thumbnail:k,authors:[a],firstBook:true,published:f,publisher:c,subtitle:g}},{id:4765,attributes:{title:e,description:j,thumbnail:k,authors:[a],firstBook:d,published:f,publisher:c,subtitle:g}},{id:4766,attributes:{title:"West Side Story",description:"The classic novelization of one of Broadway’s most enduring and beloved musicals, updated with a beautiful new cover. Maria is young and innocent and has never known love—until Tony. And Tony, searching for life beyond the savagery of the streets, has discovered love for the first time with her, too. But Maria’s brother is the leader of the Sharks and Tony had once led the rival Jets. Now, both gangs are claiming the same turf and with tensions rising to the point of explosion, it seems there is no way to stop a rumble. Tony promised Maria that he would stay out of it. But will he be able to keep his word or will their newfound love be destroyed by violence or even death? Evocative and unforgettable, this novelization brings out all of the depth, drama, and beauty of one of the most enduring stories in the history of American theater.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RMIrEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2021-05-24",publisher:"Simon and Schuster",subtitle:g}},{id:4767,attributes:{title:"Jackie",description:"Written in the 1960s, at the height of Jackie Kennedy’s popularity, this book addresses the pressures that American society placed on this strong, vibrant widow. Irving Shulman details Jackie’s life leading up to and following the death of her husband, President John F. Kennedy, focusing on the despicable and intrusive behavior of the media. Shulman sees Jackie as a victim of tabloid culture and uses her case to express his contempt for the American press.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zarZGRsoZ7kC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2000-04-01",publisher:c,subtitle:"The Exploitation of a First Lady"}},{id:4768,attributes:{title:"Harlow",description:"Harlow, An Intimate Biography, is the biography of Jean Harlow, the first of the typically American love goddesses as well as a presentation of the big-studio feudalism of the Thirties and a near sociological consideration of that American phenomenon, the sex symbol devised for mass consumption.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ZPglPswSVPAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:f,publisher:c,subtitle:"An Intimate Biography"}}]}}},meta:{}}},prerenderedAt:1681377275129}}("Irving Shulman","movie","iUniverse",null,"Cry Tough","2000-10-01","","series",1,"After being released from the Elmira reformatory Mitch (the central character of Cry Tough) has two ways to go. He could return to his family who loved him dearly, find a job and marry the girl who loved him. His other choice is the flashy, dangerous life as a hood with big risks and big rewards- cars, women, rich food and fancy apartments. Would he settle for the security of a job and family or would he take the road from which there was no turning back? In a classic story, Irving Shulman presents the struggle of one man. The allure of his life in the underworld, the sobering reality of his home life, what he really loves, what he really wants and how each element in his fragmented reality draws on him.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=d6lNIuNiR6gC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api"))